DROP TABLE IF EXISTS "TblChain";
CREATE TABLE "TblChain" ("ChainID" TEXT, "ChainName" TEXT);
DROP TABLE IF EXISTS "TblLogin";
CREATE TABLE TblLogin (userid text, username text, password text);
DROP TABLE IF EXISTS "TblQuestion";
CREATE TABLE "TblQuestion" ("Question_ID" TEXT, "Question_SurveyID" TEXT, "Question_Type" TEXT, "Question_Order" TEXT, "Question_Description" TEXT);
DROP TABLE IF EXISTS "TblQuestion_Options";
CREATE TABLE "TblQuestion_Options" ("Question_Option_ID" TEXT, "Question_ID" TEXT, "Question_Answer_Value" TEXT, "Question_Answer_Replacement_Value" TEXT);
DROP TABLE IF EXISTS "TblQuestion_Type";
CREATE TABLE "TblQuestion_Type" ("QuestionType_ID" TEXT, "QuestionType_Value" TEXT, "QuestionType_Name" TEXT);
DROP TABLE IF EXISTS "TblQuestion_Visibility";
CREATE TABLE "TblQuestion_Visibility" ("id" TEXT, "surveyID" TEXT, "QuestionID" TEXT, "QuestionOptionID" TEXT, "FollowOnQuestionID" TEXT, "LinkedQuestionVisible" TEXT, "QuestionOrder" TEXT);
DROP TABLE IF EXISTS "TblStore";
CREATE TABLE "TblStore" ("StoreID" TEXT, "ChainID" TEXT, "StoreName" TEXT);
DROP TABLE IF EXISTS "TblSubmitted";
CREATE TABLE TblSubmitted (userid text, chain text, store text, surveyname text, seqnum text, question text, answer text);
DROP TABLE IF EXISTS "TblSurvey";
CREATE TABLE "TblSurvey" ("SurveyId" TEXT, "Survey_Name" TEXT, "Survey_StartDate" TEXT, "Survey_FinalDate" TEXT, "Survey_IsStatic" TEXT);
DROP TABLE IF EXISTS "TblSurvey_Store";
CREATE TABLE "TblSurvey_Store" ("Survey_Store_ID" TEXT, "Survey_Store_SurveyID" TEXT, "Survey_Store_StoreID" TEXT, "Survey_Store_StoreName" TEXT);
